import React from "react";
import PropTypes from "prop-types";

export default function Navbar(props) {
  let navColor = {
    backgroundColor: "linear-gradient(to right, #b600ff, #d800ff)",
  };

  return (
    <>
      <nav
        className={`navbar navbar-expand-lg navbar navbar-${props.mode} bg-${props.mode} my-6 border-bottom shadow-lg p-3 mb-3`}
        style={navColor}
      >
        <div className="container-fluid">
          <a className="navbar-brand" href="/">
            {props.title}
          </a>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div
            className="collapse navbar-collapse"
            id="navbarSupportedContent"
          >
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <a className="nav-link active" href="/">
                  Home
                </a>
              </li>
              <li className="nav-item">
                <a className="nav-link active" href="/about">
                  {props.about}
                </a>
              </li>
              <li className="nav-item">
                <a className="nav-link active" href="/login">
                  Login
                </a>
              </li>
            </ul>
            <div
              className={`form-check form-switch text-${
                props.mode === "light" ? "dark" : "light"
              }`}
            >
              <input
                className="form-check-input "
                type="checkbox"
                role="switch"
                id="flexSwitchCheckChecked"
                onClick={props.togglemode}
              />
              <label htmlFor="flexSwitchCheckChecked">Enable dark mode</label>
            </div>
          </div>
        </div>
      </nav>
    </>
  );
}

Navbar.propTypes = {
  title: PropTypes.string.isRequired,
  about: PropTypes.string.isRequired,
};

Navbar.defaultProps = {
  title: "Enter title here",
  about: "About",
};
